import React from "react";
import PropTypes from 'prop-types'

const headingStyle = {
    color: 'red',
};

const Header = (props) => {
    const {turvataso} = props;
    return (
        <div>
            <h1 style={headingStyle}>Athletes {turvataso}</h1>
        </div>
    );
};

Header.defaultProps = {
    turvataso: "pieni",
}

Header.propTypes = {
    turvataso: PropTypes.string.isRequired,
};

export default Header;
